    ('EST01', 'Estopa', from_base64(''), 'taldea','Estopa taldeak (José y David Muñoz) Zaragozako abizenarekin ezaguna da. Musika arloan ibilitako anaiak, folk rock, rumba eta flamencorekin uztartutako soinu berezia sortu dute. Euren kantuek errealean bizitako esperientziak, sentimenduak eta bizitza-ikuspuntuak biltzen dituzte, eta horiek guztiak euren euskal jatorriak ikuspegi fresko eta harrigarri batekin uztartzen dituzte. Euskarak inguruko kultura eta hizkuntzaren indarrak agertzen ditu, eta estilistika ezberdinak uztartzen ditu, musika arloan denbora luzean zabaltzen den ikuspegi berri eta fresko bat eskaintzen duela.');
