    ('EMI01', 'Eminem', from_base64(''), 'bakarlaria','Marshall Mathers III izenekoak, Eminem bezala ezaguna, hip-hop munduan izan duen eragina izugarri handia da. Bere kantuek, baita testuak ere, gai garrantzitsu eta gailenduak dituzte, harremanak, zailtasunak eta bizi-ibilbideko errealitateak aipatzen dituztenak. Eminem, adierazpen askatasunaren aldeko aukera eta musika alorrean bere leialtasun eta ardura azpimarratzen dituen artistarik ikaragarrienetako bat da.'); 
    
    
    ('TAS01', 'Taylor Swift', from_base64(''),'bakarlaria', 'Taylor Swift, country eta pop musikaren arteko batasunak edo hibridoak dituen artistarik ospetsuenetakoa da. Bere kantuek sentimendu zorrotzak eta esperientziak azaltzen dituzte, eta irudi publikoa dela-eta, harremanak eta bizitzako erronkak ere berariaz azaltzen ditu. Swift-ek, bere musikarekin edo gizartean bizi diren gai sozial eta politikoetan adierazi beharrekoan, bere ahotsa eta agertzea ditu lehentasun.');
    
  
    ('XII01', 'Roten XIII', from_base64(''), 'taldea' , ' Euskal Herriko musika eszenaren icona eta erreferentea da. Hurrengo izen berak hartzen dituen hiru musikari ezberdinak, Mikel Laboa, Benito Lertxundi eta Lourdes Iriondo, berezitasun eta talento berezia dituzte. Euren kantuek euskal kulturaren loreak eta gai sozialak jorratzen dituzte, eta estilo politikoa eta sentibera izaten dute. Roten Amairu, euskal musika eta kultura munduan zutik dituen lekua goraipatzeko, eta euren abesti klasikoek euskal herria eta bere jendea bereziki sentitu ohi dute.');
   
    
   
    ('BUL01', 'Bulego', from_base64(''), 'taldea', 'Euskal Herriko indie musika eskenean kokatzen den taldea da. Bere soinuak elektronika eta rock estiloak uztartzen ditu, eta testuak gehienbat euskara daude. Bulegok, gai sozial eta politikoak jorratzen dituen kantak egin ditu, eta musika-ekintza sozial gisa ere jarduten du, bertako komunitatearekin harreman zuzenak izateko ahaleginak eginez. Taldeak modernotasun eta tradizioak batzen ditu, eta euren musikak euskal kulturaren eta gizarteko errealitatearen ardatz nagusiak hartzen ditu.');


